import Pizza from "./Pizza";
import { pizzaData } from "../data/data";

function Menu() {
    return (
        <div className="menu">
            <h2>Our Menu</h2>
            <div className="pizzaContainer">
                <Pizza
                    name="Focaccia"
                    ingredients="Bread with italian olive oil and rosemary"
                    price="6"
                    photoName="../assets/images/sou.png"
                    soldOut="false"
                />
            </div>
        </div>
    );
}

export default Menu;
